<script>
  import cus from './x-customservice'
  export default {
    name: 'mall',
    data () {
      return {
        scrollTop: 0,
        showMenu: false,
        hotimg:[
          'data:image/png;base64,',
          'data:image/png;base64,',
          'data:image/png;base64,',
          'data:image/png;base64,',
          'data:image/png;base64,',
          'data:image/png;base64,'
        ],
        isrc: [
          'http://www.xiaochong.com/static/img/top1129.a16fa96.jpg',
          'http://www.xiaochong.com/static/img/timebg.01b7c43.jpg',
          'http://www.xiaochong.com/static/img/ptbg.e89de12.png',
          'http://www.xiaochong.com/static/img/timebg.01b7c43.jpg',
          'http://www.xiaochong.com/static/img/top1129.a16fa96.jpg',
        ],
        menu: [
          {text: '热销<br>机型', active: false, scrollheight: '', menutext: 'menu0'},
          {text: '行政<br>专区', active: false, scrollheight: '', menutext: 'menu1'},
          {text: '研发<br>专区', active: false, scrollheight: '', menutext: 'menu2'},
          {text: '商务<br>便携', active: false, scrollheight: '', menutext: 'menu3'},
          {text: '高端<br>机型', active: false, scrollheight: '', menutext: 'menu4'},
          {text: '最新<br>上架', active: false, scrollheight: '', menutext: 'menu5'}

        ],
        timer: '',
        isTop: false
      }
    },
    methods: {

      stopScrollAnimate(){
        if (!vm.isTop) {
          clearInterval(vm.timer);
        }
        vm.isTop = false;
      },
      changeScroll(item){
        clearInterval(this.timer)

        var num = item.scrollheight - 100;

        var vm = this

        //滚动条滚动时触发

        vm.timer = setInterval(function () {
          //获取滚动条距离顶部高度
          var osTop = document.documentElement.scrollTop || document.body.scrollTop;

          var ispeed = Math.floor((num - osTop) / 7);
          document.documentElement.scrollTop = document.body.scrollTop = osTop + ispeed;

          if (osTop === num || ispeed === 0) {

            clearInterval(vm.timer);

          }
          vm.isTop = true;

        }, 20);


      },
      getMenuOffset(){
        this.menu[0].scrollheight = this.$refs.menu0.offsetTop
        this.menu[1].scrollheight = this.$refs.menu1[0].offsetTop
        this.menu[2].scrollheight = this.$refs.menu2[0].offsetTop
        this.menu[3].scrollheight = this.$refs.menu3[0].offsetTop
        this.menu[4].scrollheight = this.$refs.menu4[0].offsetTop
        this.menu[5].scrollheight = this.$refs.menu5[0].offsetTop


      },
      removeActive(){
        for (var i = 0; i < this.menu.length; i++) {
          this.menu[i].active = false
        }
      },
      handleScroll(){
        var scrollTop = window.pageYOffset || document.documentElement.scrollTop || document.body.scrollTop
        this.scrollTop = scrollTop

      }
    },
    created(){
      window.addEventListener('scroll', this.handleScroll)
      window.addEventListener('onscroll', this.stopScrollAnimate)
    },
    watch: {
      scrollTop(num){
        if (num > 500) {
          this.showMenu = true
        } else {
          this.showMenu = false
        }

        var half = window.innerHeight / 2

        for (var i = 0; i < this.menu.length; i++) {
          if (num + half > this.menu[i].scrollheight) {
            this.removeActive()
            this.menu[i].active = true
          }
        }
      }
    },
    mounted(){
      this.getMenuOffset()
      var mySwiper = new Swiper('.swiper-container', {
        spaceBetween: 30,
        centeredSlides: true,
        effect: 'fade',
        loop:true,
        autoplay: {
          delay: 2500,
          disableOnInteraction: false,
        },
        pagination: {
          el: '.swiper-pagination',
          clickable: true,
        },
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev',
        },

      })

    },
    components: {
      cus: cus
    }
  }
</script>

